Test: Basic Table Layout

        /* Reset for consistency */
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { 
            font-family: 'Arial', sans-serif; 
            font-size: 16px; 
            line-height: 1.5;
            padding: 20px;
            max-width: 800px;
        }

        /* Table styles */
        table {
            border-collapse: collapse;
            width: 100%;
            margin: 16px 0;
        }

        th, td {
            border: 1px solid #d1d9e0;
            padding: 8px 12px;
            text-align: left;
        }

        th {
            background-color: #f6f8fa;
            font-weight: bold;
        }

        tr:nth-child(even) {
            background-color: #f9f9f9;
        }

        h3 {
            font-size: 20px;
            margin-bottom: 12px;
            font-weight: bold;
        }

        p {
            margin-bottom: 16px;
        }



